  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1961.
  The report begins by summarizing the weather, water, and habitat conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, raptors, fish, and reptiles-
  is also covered. The Refuge development and maintenance section discusses physical
  development, plantings, collections and receipts, and vegetation control. Resource
  management is outlined; topics include grazing and haying. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, and Refuge participation.
  Items of interest, photographs, and N-R forms are attached.\",\n\t\"license_title\":
